import React from 'react'
import Moviedata from './moviedb'

class MovieList extends React.Component {
    render(){
        return (
            <React.Fragment>
                {
                    Moviedata.map(movie)
                }
            </React.Fragment>
        );
    }
}

export default MovieList;
